import React, { useState } from "react";
import { CSSTransition } from "react-transition-group";
import "../styles/Menu.css";

function Menu(props) {
  const [clicked, setClicked] = useState(false);

  const handleClick = () => {
    setClicked(!clicked);
  };

  return (
    <>
      <div
        className={`icon nav-icon-1 ${clicked ? "open" : ""}`}
        onClick={handleClick}
      >
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
      </div>
      <CSSTransition
        in={clicked}
        timeout={500}
        classNames="menu-animation"
        unmountOnExit
      >
        <ul className={`main-nav ${clicked ? "active" : ""}`}>
          <li>
            01<a>Home</a>
          </li>
          <li>
            02<a>About</a>
          </li>
          <li>
            03<a>Portfolio</a>
          </li>
          <li>
            04<a>Contact</a>
          </li>
        </ul>
      </CSSTransition>
    </>
  );
}

export  {Menu};
